import React from 'react';
import {BrowserRouter} from 'react-router-dom'
import MainPage from '../screens/MainPage/MainPage'

import './App.scss';


function App() {
  return (
    <BrowserRouter>
        <MainPage/>

        <Route path="/servicepage" exact component={ServicePage}/>
    </BrowserRouter>

  );
}

export default App;
